void CalculateDiscreteFourierTransform(float* time_series, int time_series_size, float* fourier_output)
{
    int cos_table_idx = 0, sin_table_idx = 0;
    for (int i = 0; i < (time_series_size / 2) + 1; ++i) {
    float real = 0;

    for (int j = 0; j < time_series_size; ++j) {
      real += time_series[j] * cos(j * i * M_PI * 2 / time_series_size);
      //real += time_series[j] * fft_cos_table[cos_table_idx++];
    }

    float imaginary = 0;
    for (int j = 0; j < time_series_size; ++j) {
      imaginary -= time_series[j] * sin(j * i * M_PI * 2 / time_series_size);
      //imaginary -= time_series[j] * fft_sin_table[sin_table_idx++];
    }
    fourier_output[(i * 2) + 0] = real;
    fourier_output[(i * 2) + 1] = imaginary;
  }
}

void CalculateInverseDiscreteFourierTransform(float* fourier_input, int fourier_input_size, float* time_series)
{
    for (int i = 0; i < ((fourier_input_size - 1)*2); ++i) {
    time_series[i] = 0;
    for (int j = 0; j < (((fourier_input_size - 1)*2)/2)+1; ++j) {
       time_series[i] += fourier_input[(j*2) + 0] * cos(j * i * M_PI * 2 / ((fourier_input_size - 1) * 2))
               - fourier_input[(j*2) + 1] * sin(j * i * M_PI * 2 / ((fourier_input_size - 1) * 2));
    }
    int k = 2;
    for (int j = (((fourier_input_size - 1)*2)/2)+1; j < ((fourier_input_size - 1)*2); ++j) {
       time_series[i] += fourier_input[((j-k)*2) + 0] * cos(j * i * M_PI * 2 / ((fourier_input_size - 1) * 2))
                   + fourier_input[((j-k)*2) + 1] * sin(j * i * M_PI * 2 / ((fourier_input_size - 1) * 2));
       k=k+2;
    }
    time_series[i] /= ((fourier_input_size - 1) * 2);
    //printf("time_series[i]=%f\n", time_series[i]);
    }
}
